    private final SuitStatus suitStatus;
    private final Rank topRank;
    private final Rank lowRank;
    private final double strength;
    private final EnumSet<Rank> ranks;
    private final Connector connector;
    private final EnumSet<CardPair> cardPairs;

    public static final Map<String, CardCell> map = new HashMap<>();

    static {

        Arrays.stream(values()).forEach(cardCell -> {
            Rank tr = cardCell.topRank;
            Rank lr = cardCell.lowRank;
            SuitStatus ss = cardCell.suitStatus;
            String straightName = tr.letter() + lr.letter() + ss.letter();
            map.putIfAbsent(straightName, cardCell);
            if (ss != SuitStatus.EQUAL_RANKS) {
                String reversedName = lr.letter() + tr.letter() + ss.letter();
                map.putIfAbsent(reversedName, cardCell);
            }
        });
    }

    public EnumSet<CardPair> getCardPairs() {
        return cardPairs;
    }

    public double getStrength() {
        return strength;
    }

    private final String stdName;

    CardCell(SuitStatus suitStatus, Rank topRank, Rank lowRank, double strength, Connector connector, EnumSet<CardPair> cardPairs) {
        this.suitStatus = suitStatus;
        this.topRank = topRank;
        this.lowRank = lowRank;
        this.strength = strength;
        this.connector = connector;
        this.cardPairs = cardPairs;
        this.ranks = Stream.of(topRank, lowRank).collect(Collectors.toCollection(() -> EnumSet.noneOf(Rank.class)));
        this.stdName = topRank.letter() + lowRank.letter() + suitStatus.letter();
    }

    CardCell(SuitStatus suitStatus, Rank rank, double strength, Connector connector, EnumSet<CardPair> cardPairs) {
        this(suitStatus, rank, rank, strength, connector, cardPairs);
    }

    public static CardCell from(Card card1, Card card2) {
        String stdName = card1.rank() == card2.rank() ? (card1.rank().letter() + card2.rank().letter()) :
                (card1.suit() == card2.suit() ? (card1.rank().letter() + card2.rank().letter() + SuitStatus.SUITED.letter()) :
                        (card1.rank().letter() + card2.rank().letter() + SuitStatus.OFF_SUITED.letter()));
        return from(stdName);
    }

    public static CardCell from(String stdName) {
        return map.get(stdName);
    }

    public static CardCell from(Cards pocketCards) {
        return from(pocketCards.cards().toArray(Card[]::new)[0], pocketCards.cards().toArray(Card[]::new)[1]);
    }

    public SuitStatus suitStatus() {
        return suitStatus;
    }

    public Rank topRank() {
        return topRank;
    }

    public Rank lowRank() {
        return lowRank;
    }

    @Override
    public double normalizedNumeric() {
        return strength;
    }

    public EnumSet<Rank> ranks() {
        return ranks;
    }

    public boolean contains(Rank rank) {
        return ranks.contains(rank);
    }

    public Connector connector() {
        return connector;
    }

    public String stdName() {
        return stdName;
    }


    @Override
    public String toString() {
        return stdName;
    }
